import React, {useState} from "react";
import {Box, Column, Container, FooterLink, Heading, Row} from "../Footer/FooterStyles";
import styled from "styled-components";

export  function ViewShops(props){
    const [shops, setShops] = useState([])
    const Box = styled.div`
  padding: 40px 10px;
  background: #0C797D;
  position: absolute;
  bottom: 20;
  marginRight: 0;
  left: 50;
  width: 20%;


  @media (max-width: 1000px) {
    padding: 70px 30px;
  }
`;
    return(
        <>
            {setShops(props.shops)}
        <Box>
            <Container>
                <Row>
                    {shops.length > 0 ? shops.map((item)=>
                        <Column>
                            <Heading>{shops.storeName}</Heading>
                            <FooterLink href="#">Vision</FooterLink>
                            <FooterLink href="#">Testimonials</FooterLink>
                        </Column>)
                        :
                        <h1>NoShops</h1>
                    }
                </Row>
            </Container>
        </Box>
        </>
    );
}
